import React, { FC } from 'react';

import Link from 'next/link';
import PostLink from 'next/link';
import { ItemWrapper, Item, Title } from "./CardStyles";

interface Props {
  title?: string;
  children?: any;
  id?: any;
}

export const Card: FC<Props> = ({ title, id, children }) => (
  <Item>
      <ItemWrapper>
              <Title>
                  <Link></Link>
                  <PostLink href={id}/>
              </Title>
          }
          { children }
      </ItemWrapper>
  </Item>
);
